import React from "react";
import './AddCleatModal.css';

const AddCleatModal = ({ handleClose, show }) => {

    const showAddCleatModal = show ? 'modal display-block' : 'modal display-none';
    const children = ['bacon', 'egg', 'cheese'];

    return (
        <div className={showAddCleatModal} >
            <div className="form-perimeter">

                <form>
                    <label for="cname">Cleat name:</label><br/>
                    <input type="text" id="cname" name="cname" /><br/>
                    <label for="cyear">Make Year:</label><br/>
                    <input type="text" id="cyear" name="cyear" /><br/>
                </form>

                <button className="thing" type="button" onClick={handleClose}>
                    Close
                </button>
            </div>
        </div>
    );
}

export default AddCleatModal;
